import React from 'react'
import {StyleSheet, Text,View,TouchableOpacity} from 'react-native';

const GridPrikaz = (props) => {
    return(
        <TouchableOpacity
        style={stil.Element}
        onPress={props.odabir}
        >
            <View 
            style= {{...stil.okvir,...{backgroundColor: '#FE2F57'}}}>
                <Text style={stil.naslov}>{props.naziv}</Text>
            </View>
        </TouchableOpacity>
    )
}

const stil=StyleSheet.create( {
Element: {
    flex:1,
    margin:15,
    height: 150
},
okvir:{
flex:1,
borderRadius:15,
elevation: 5,
padding: 10,
justifyContent: 'flex-end',
alignItems: 'flex-end'
},
naslov: {
   // fontFamily: ''
   fontSize:22,
   textAlign: 'rigth'
}
});

export default GridPrikaz;
